  false,\n\t\"url\": null,\n\t\"notes\": \"Data set includes available climatological
  and related physical environmental records for Auke Bay, Auke Creek and Auke Lake
  beginning in 1959.  Daily high and low air temperatures,  precipitation, snow fall,
  snow on the ground,  cloud cover, sea surface temperature, surface salinity, Secchi
  disc depth and water color are taken at the Auke Bay Laboratory.  Daily stream temperatures
  are taken at the Auke Creek Weir. Three meter depth Auke Lake Temperatures are recorded
  and the Auke Creek Hatchery in take pipe in the lake.\",\n\t\"license_title\": null,\n\t\"extras\":
